import { NavLink } from "react-router-dom";
import ProductModel from "../../../Models/ProductModel";
import globals from "../../../Services/Globals";
import Table from "@material-ui/core/Table";
import TableBody from "@material-ui/core/TableBody";
import TableCell from "@material-ui/core/TableCell";
import TableContainer from "@material-ui/core/TableContainer";
import TableHead from "@material-ui/core/TableHead";
import TableRow from "@material-ui/core/TableRow";
import Paper from "@material-ui/core/Paper";
import "./ProductCard.css";

interface ProductCardProps {
    product: ProductModel;
}

function ProductCard(props: ProductCardProps): JSX.Element {
    return (

        <div className="ProductCard ">


            <NavLink to={"/products/details/" + props.product.login.username}>
                <img src={props.product.picture.thumbnail} />
            </NavLink>
            <TableContainer component={Paper}>
                <Table aria-label="simple table">
                    <TableHead>
                        <TableRow>
                            <TableCell>Picure </TableCell>
                            <TableCell>FullName</TableCell>
                            <TableCell>Email</TableCell>
                            <TableCell>Gender</TableCell>
                            <TableCell>Age</TableCell>
                        </TableRow>
                    </TableHead>
                    <TableBody >
                        <TableRow className="Hover">
                            <TableCell>

                            </TableCell>
                            <TableCell>   {props.product.name.first}  {props.product.name.last}</TableCell>
                            <TableCell>{props.product.gender}</TableCell>
                            <TableCell>{props.product.email}</TableCell>
                            <TableCell>{props.product.dob.age}</TableCell>
                        </TableRow>
                    </TableBody>
                </Table>
            </TableContainer>






            <div>
                Name:
                {props.product.name.first}  {props.product.name.last}
                <br />
                gender: {props.product.gender}
                <br />
                email: {props.product.email}
            </div>

        </div>
    );
}

export default ProductCard;
